import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Welcome from './pages/Welcome';
import Products from './pages/Products';
import MainHeader from './components/MainHeader';

function App() {
  return (
    <BrowserRouter>
      <MainHeader />
      <Routes>
      <Route path='/welcome' >
         <Welcome />
      </Route>
      <Route path='/products' >
        <Products />
      </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
